import {
  Theme,
  createStyles
} from "@material-ui/core/styles";

const styles = (theme: Theme) => createStyles({
  root: {
    padding: "10px 20px",
    height: 70,
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center'
  },
  formLabel: {
    width: '100%',
  }
})

export default styles
